css:
.transition-03 {
  transition: 0.3s ease;
}
body {
  font-size: 11px;
  color: #c1c1c1;
  background-color: #000;
}
atom-pane {
  border-right: 1px solid #171717;
}
atom-pane:last-child {
  border-right: none;
}
atom-pane-container atom-pane .item-views > * {
  top: 5px;
  bottom: 5px;
}
.icon::before {
  position: relative;
  top: 1px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  border-radius: 5px;
  border: 3px solid transparent;
  background: #171717;
  background-clip: content-box;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:vertical:active {
  border-radius: 0;
  border-left-width: 0;
  border-right-width: 0;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:horizontal:active {
  border-radius: 0;
  border-top-width: 0;
  border-bottom-width: 0;
}
.btn {
  color: #d0d0d0;
  background-color: #121212;
}
.btn:focus,
.btn:hover {
  color: #F8F8F0;
  background-color: #1a1a1a;
}
.btn:active {
  color: rgba(206, 206, 206, 0.66);
  background-color: #0d0d0d;
}
.btn.selected {
  color: #cecece;
  background-color: #1a1a1a;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn .icon::before {
  position: relative;
  top: 1px;
}
.btn.btn-primary {
  color: #F8F8F0;
  background-color: #307846;
}
.btn.btn-primary:focus,
.btn.btn-primary:hover {
  background-color: #36874f;
}
.btn.btn-primary:active {
  background-color: #2a693e;
}
.btn.btn-primary.selected {
  background-color: #36874f;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #3c9557;
}
.btn.btn-info {
  color: #F8F8F0;
  background-color: #2f5166;
}
.btn.btn-info:focus,
.btn.btn-info:hover {
  background-color: #365c74;
}
.btn.btn-info:active {
  background-color: #294658;
}
.btn.btn-info.selected {
  background-color: #365c74;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #3c6782;
}
.btn.btn-success {
  color: #F8F8F0;
  background-color: #307846;
}
.btn.btn-success:focus,
.btn.btn-success:hover {
  background-color: #36874f;
}
.btn.btn-success:active {
  background-color: #2a693e;
}
.btn.btn-success.selected {
  background-color: #36874f;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #3c9557;
}
.btn.btn-warning {
  color: #F8F8F0;
  background-color: #c06023;
}
.btn.btn-warning:focus,
.btn.btn-warning:hover {
  background-color: #d16926;
}
.btn.btn-warning:active {
  background-color: #af5720;
}
.btn.btn-warning.selected {
  background-color: #d16926;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #da7332;
}
.btn.btn-error {
  color: #F8F8F0;
  background-color: #ae2323;
}
.btn.btn-error:focus,
.btn.btn-error:hover {
  background-color: #bf2727;
}
.btn.btn-error:active {
  background-color: #9d2020;
}
.btn.btn-error.selected {
  background-color: #bf2727;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #d02a2a;
}
.btn-group > .btn {
  transition: 0.3s ease;
  border-color: rgba(0, 0, 0, 0.2);
}
.atom-dock-toggle-button-visible {
  display: none;
}
atom-text-editor,
:host {
  background: #000;
}
atom-text-editor.editor .cursor {
  border-width: 2px;
  border-color: #d5d5d5;
  transform: translateX(-1px);
}
atom-text-editor.editor .bracket-matcher .region {
  background: rgba(255, 255, 255, 0.1);
  border: none;
}
atom-text-editor[mini] {
  padding-left: 4px;
  color: #c1c1c1;
  background-color: #000;
  box-shadow: 0 1px 0 0px #171717;
}
atom-text-editor[mini].is-focused {
  background-color: #0d0d0d;
}
atom-text-editor[mini].editor .placeholder-text {
  color: #818181;
}
atom-text-editor[mini].editor .selection .region {
  background-color: #212121;
}
.linter-highlight.linter-gutter.linter-error {
  color: #e68484 !important;
}
.linter-highlight.linter-gutter.linter-warning {
  color: #dedda5 !important;
}
.linter-highlight .region {
  border-bottom: none !important;
}
.linter-highlight .region::before {
  display: block;
  position: absolute;
  content: '';
  border-radius: 5px;
  border: 1px solid transparent;
  top: -1px;
  bottom: -1px;
  left: -6px;
  right: -6px;
}
.linter-highlight.linter-error .region::before {
  background-color: #440e0e;
  border-color: #6e1616;
}
.linter-highlight.linter-warning .region::before {
  background-color: #29280f;
  border-color: #616023;
}
#linter-tooltip linter-message {
  background-color: #121212;
  box-shadow: 0 0 10px 2px #000;
  border-width: 0px !important;
  border-radius: 5px;
  padding: 0.125em 0.5em;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
#linter-tooltip linter-message.error {
  background-color: #2f0909;
  border-color: #6e1616 !important;
}
#linter-tooltip linter-message.warning {
  background-color: #29280f;
  border-color: #616023 !important;
}
#linter-tooltip linter-message *::before {
  display: none;
}
.find-and-replace {
  border-top: 1px solid #171717;
}
.status {
  color: #c1c1c1;
}
.status-added {
  color: #78c991;
}
.status-ignored {
  color: #818181;
}
.status-modified {
  color: #71a0bd;
}
.status-removed {
  color: #e68484;
}
.status-renamed {
  color: #71a0bd;
}
atom-text-editor .gutter .line-number.git-line-modified {
  border-color: #71a0bd;
}
atom-text-editor .gutter .line-number.git-line-added {
  border-color: #78c991;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 4px;
  line-height: 2;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #000;
}
.list-group li {
  padding-left: 4px;
}
.list-group li.selected {
  color: #cecece;
  background-color: #181818;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #cecece;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  color: #c1c1c1;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li.status-modified,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li.status-modified {
  color: #ebb491;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li .status-added,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li .status-added {
  color: #78c991;
}
.select-list li {
  padding: 4px 8px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 4px;
  border-radius: 2px;
  background-color: #000;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 4px;
}
.select-list.popover-list .list-group li {
  padding-left: 4px;
}
.markdown-preview:not([data-use-github-style]) {
  background: #000;
  color: #c1c1c1;
}
.panel-heading {
  border-bottom: 1px solid #171717;
  background-color: #000;
}
.inset-panel {
  background-color: #000;
}
.inset-panel .panel-heading {
  background-color: #0a0a0a;
}
atom-panel.modal {
  border: 1px solid #171717;
  border-top: none;
}
.inset-panel {
  border-radius: 3px;
}
.sb-table {
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.settings-view .link {
  color: #71a0bd;
}
.settings-view .link:hover {
  color: #9cc6e2;
}
.settings-view .alert {
  border: none;
}
.settings-view .config-menu {
  background: #000;
}
.settings-view .config-menu .panels-menu li a {
  transition: 0.3s ease;
}
.settings-view .config-menu .panels-menu li.active a {
  background: #181818;
}
.settings-view .config-menu .panels-menu li:hover {
  background: #0d0d0d;
}
.settings-view .package-card {
  transition: 0.3s ease;
  background: #181818;
  border: none;
}
.settings-view .package-card:hover {
  background: #0d0d0d;
}
.input-checkbox:checked {
  background-color: #71a0bd;
}
.ui-site-1 {
  background-color: #9cc6e2;
}
.ui-site-2 {
  background-color: #89dfa9;
}
.ui-site-3 {
  background-color: #ebb491;
}
.ui-site-4 {
  background-color: #baaad9;
}
.ui-site-5 {
  background-color: #dedda5;
}
.status-bar {
  font-size: 11px;
  border-top: 1px solid #171717;
  background-color: #121212;
}
.status-bar:not(:hover) > * {
  opacity: 0.4;
}
.status-bar > * {
  opacity: 1;
  transition: opacity 0.1s linear;
}
.tab-bar {
  background-color: #000;
  border-top: 0px solid #171717;
  border-bottom: 1px solid #171717;
}
.tab-bar .tab {
  color: #818181;
  height: 33px;
  line-height: 33px;
  font-size: 11px;
  border-right: 1px solid #171717;
  background-color: #000;
  padding-right: 25px;
}
.tab-bar .tab .title {
  font-weight: 300;
}
.tab-bar .tab .title .icon::before {
  font-size: 13px;
}
.tab-bar .tab.active {
  flex: 1;
  color: #cecece;
}
.tab-bar .tab.active .title {
  padding: 0;
}
.tab-bar .tab.modified .title {
  color: #78c991;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 12px;
  margin-top: -3px;
  border-color: #71a0bd;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon {
  opacity: 0;
}
.tab-bar .tab .close-icon::before {
  text-align: center;
}
.tab-bar .tab .close-icon:hover {
  color: #cecece;
}
.tab-bar .tab.active .close-icon:hover {
  color: #c1c1c1;
}
.tab-bar .tab.is-dragging {
  background: #000000;
  border-color: transparent;
  opacity: 0.5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.tab-bar .tab:hover .close-icon {
  opacity: 1;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #818181;
}
.text-highlight {
  color: #F8F8F0;
}
.text-info {
  color: #71a0bd;
}
.text-success {
  color: #78c991;
}
.text-warning {
  color: #ebb491;
}
.text-error {
  color: #e68484;
}
.highlight {
  padding: 3px 5px;
  color: #F8F8F0;
  font-weight: 400;
  border-radius: 2px;
  background-color: #0d0d0d;
}
.highlight-info {
  padding: 3px 5px;
  color: #F8F8F0;
  font-weight: 400;
  border-radius: 2px;
  background-color: #2f5166;
}
.highlight-warning {
  padding: 3px 5px;
  color: #F8F8F0;
  font-weight: 400;
  border-radius: 2px;
  background-color: #c06023;
}
.highlight-error {
  padding: 3px 5px;
  color: #F8F8F0;
  font-weight: 400;
  border-radius: 2px;
  background-color: #ae2323;
}
.highlight-success {
  padding: 3px 5px;
  color: #F8F8F0;
  font-weight: 400;
  border-radius: 2px;
  background-color: #307846;
}
.background-message {
  font-weight: 400;
  color: #818181;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: 0.75em;
  white-space: nowrap;
  max-width: none;
  color: #FFF;
  background-color: #6b6378;
}
.tooltip .keystroke {
  padding: 0.15em 0.4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #FFF;
  background: #181818;
}
.tree-view-resizer {
  border-top: 2px solid #000;
  border-right: 0px solid #000;
  border-left: 1px solid #171717;
}
.tree-view {
  color: #c1c1c1;
  background-color: #121212;
  font-weight: 300;
}
.tree-view .list-item.selected {
  color: #cecece;
}
.tree-view .list-item.selected::before {
  background: #0f0f0f;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li.status-modified,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li.status-modified {
  color: #9cc6e2;
}
.atom-dock-open .tab-bar {
  display: none;
}
